import React from "react";
import mePic from "./../Pages/imgs/me.png";
import "./../App.css";

const About = () => {
  return (
    <>
      <div className="banner-image paraPort">
        <h1 className="banner-header">About</h1>
      </div>
      <div className="under-paraport">
        <div className="about-me">
          <img
            className="about-me-img"
            src={mePic}
            alt="this is me"
            style={{ width: "500px" }}
          />
          <p id="aboutMeText">
            Hey! Welcome to my site! My name is Lauren Hutchinson and after
            moving home from spending a couple of years working as a fitness
            instructor in New York City at Barrys Bootcamp, I decided to go back
            to school for coding..
            <br />
            <br />
            I'm so excited to begin my new coding career. When I'm not coding,
            I'm usually teaching myself how to DJ, skateboarding, or hanging out
            with friends. Coding challenges me in a new way and I'm grateful for
            this opportunity to expand.
          </p>
        </div>
      </div>
    </>
  );
};

export default About;
